import React from "react";
import "./App.css";
import Container from "./components/ContainerBlock/Container";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Container path="/" component={Container}/>
      </BrowserRouter>
    </div>
  );
}

export default App;
